// export default ListOfStudents
import React from "react";
import { connect } from "react-redux";
import {
  Container,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  Card,
} from "@material-ui/core";
import { Link } from "react-router-dom";

const ListOfStudents = (props) => {
  let loggedIn = document.cookie;
  const students = ListOfStudents;
  return (
    <Container maxWidth="lg" className="students-container">
      <div className="Gallery">
      <Table>
      <TableHead>
          <TableRow>
              <TableCell>Id</TableCell>
              <TableCell>Make/Model</TableCell>
              <TableCell>MPG</TableCell>
              <TableCell>Cylinders</TableCell>
              <TableCell>Horsepower</TableCell>
              <TableCell>Delete</TableCell>
          </TableRow>
      </TableHead>
      <TableBody>
      {props.cars.map((car, idx) => (
          <TableRow key={car.id}>
              <TableCell component="th" scope="row">
                  {car.id}
              </TableCell>
              <TableCell>{car["name"]}</TableCell>
              <TableCell>{car["mpg"]}</TableCell>
              <TableCell>{car["cylinders"]}</TableCell>
              <TableCell>{car["horsepower"]}</TableCell>
              <TableCell>
                  <DeleteIcon
                      // add onClick method here
                      onClick = { () => props.removeCar(car.id)}
                      className="icon text-red" />
              </TableCell>
          </TableRow>
      ))}
      </TableBody>
  </Table>
      </div>
    </Container>
  );
};

export default ListOfStudents;
